import React from 'react';
import './App.css';
import usLocation from './images/US.jpg';
import world from './images/world.jpg';


function Location() {
return( <div className="location">
                 
                <div className="us-location">
                <a href=""><div class="img-container"><img src={usLocation}/></div>US</a>
                </div>
                <div className="world-location">
                <a href=""><div class="img-container"><img src="images/world.jpg" alt="" srcset=""/></div>WORLD</a>
                </div>
        </div> );
}


export default Location;
